# encoding functions, provided by GPT
# note that these are simply utilities to reduce the string size and don't aid in solving the problem
def encode_unicode(s):
    # Convert the string into bytes (e.g., ASCII values)
    b = s.encode('utf-8')
    # Pad with 0 if odd length
    if len(b) % 2 == 1:
        b += b'\x00'
    # Pack every 2 bytes into a Unicode character
    return ''.join(chr(b[i] << 8 | b[i + 1]) for i in range(0, len(b), 2))


def decode_unicode(uc):
    # Unpack each Unicode character into 2 bytes
    b = bytearray()
    for c in uc:
        v = ord(c)
        b.append(v >> 8)
        b.append(v & 0xFF)
    return b.rstrip(b'\x00').decode('utf-8')  # remove padding and decode


